export default {
	CurrentUserId: () => { return 1 },
	UpdateAll: async () => {
		await GetAllUsers.run();
		await GetAllAverages.run();
	},
	GetUsersAverages: () => {
		let users = GetAllUsers.data;
		let averages = GetAllAverages.data;
		return users.map(u => {
			u.Averages = averages.filter(a => a.UserId === u.Id);
			return u;
		});
	},
	GetUser: (id) => { return Data.GetUsersAverages().find(u => u.Id === id) },
	GetCurrentUser: () => { return Data.GetUser(Data.CurrentUserId()); },
	GetUsersOfCountry: (country) => {
		return Data.GetUsersAverages().filter(u => u.Country === country)
			.sort((a, b) => { a.Sum > b.Sum });
	},
	GetCountries: () => {
		return GetAllUsers.data.map(u => u.Country).filter((v, i, s) => s.indexOf(v) == i);
	},
	GetAverageSpendingInCountry: (country) => {
		return Data.
	}
}
